import React, { useEffect, useState } from 'react'
import Header from '../Header/Header'
import axios from 'axios';
import ApiEndPoint from '../ApiEndPoint/ApiEndPoint';

function Recptionlist() {
  let token = sessionStorage.getItem('token');

  const [recptionistData,setRecptionistData] = useState();

  useEffect(async () => {
    let response = await axios.get(ApiEndPoint.getReception, {
      headers: { Authorization: 'Bearer ' + token }
    });
    setRecptionistData(response.data);
    console.log(recptionistData);// This might not reflect the updated state
  
  }, []);
  
  return (
    <>
      <Header />
      <div className="container mt-2">
        <table className="table">
          <thead>
            <tr>
              <th>S No.</th>
              <th>Id</th>
              <th>Name</th>
              <th>Contact</th>
              <th>Password</th>
              <th>Address</th>
              <th>Operation</th>
            </tr>
          </thead>
          <tbody>
            {recptionistData.map((reception, index) => 
              <tr key={index}>
                <td>{index + 1}</td>
                <td>{reception.id}</td>
                <td>{reception.name}</td>
                <td><b>{reception.phoneNumber}</b><br/><i>{reception.email}</i></td>
                <td>{reception.password}</td>
                <td>{reception.raddress}</td>
                <td>
                  <button className="btn btn-dark">Delete</button>
                </td>
              </tr>
            )}
          </tbody>
        </table>
      </div>
    </>
  );
}

export default Recptionlist
